CREATE TABLE IF NOT EXISTS users (
    `id` VARCHAR(255) PRIMARY KEY,
    `fullname` VARCHAR(255),
    `email` VARCHAR(255) UNIQUE,
    `username` VARCHAR(255) UNIQUE,
    `password` VARCHAR(255),
    `refresh_token` VARCHAR(1024),
    `created_at` DATETIME,
    `updated_at` DATETIME,
    `is_admin` BOOLEAN
);
